import styled, {createGlobalStyle} from "styled-components";
import GardenDesktop from "../assets/garden_desktop.jpg"
import WankstabergBattles from "../assets/WankstabergBattles.ttf"

export default createGlobalStyle`
    @font-face {
        font-family: 'Wankstaberg Battles';
        src: local('Wankstaberg Battles'), local('Wankstaberg Battles'),
        url(${WankstabergBattles}) format('ttf');
        font-weight: 300;
        font-style: normal;
    }
`;

export const CupideonHomeWrapper = styled.div`
  height: 100vh;
  width: 100vw;
  background: url(${GardenDesktop});
  background-size: cover;
  position: relative;
`

export const CupideonHomeTitle = styled.h1`
  font-family: Wankstaberg Battles;
`
